import type { Meta, StoryObj } from '@storybook/react'
import { within, fireEvent } from '@storybook/testing-library'
import { expect, jest } from '@storybook/jest'

import ProfileBanner from '.'

const url =
  'data:image/jpeg;base64,'

const meta = {
  title: 'Components/ProfileBanner',
  component: ProfileBanner,
  tags: ['autodocs'],
  args: {
    name: 'Henrique',
    job: 'Frontend Developer',
    avatarUrl: url,
    handleContactClick: jest.fn(),
    message:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus elit arcu, pellentesque ac dictum vel, pulvinar eu lorem. Aliquam iaculis iaculis augue id cursus.'
  },
  argTypes: {
    name: { control: 'text' },
    job: { control: 'text' },
    avatarUrl: { control: 'text' },
    message: { control: 'text' }
  }
} satisfies Meta<typeof ProfileBanner>

export default meta
type Story = StoryObj<typeof meta>

export const Primary: Story = {
  args: {}
}

Primary.play = async ({ canvasElement, step, args }) => {
  const canvas = within(canvasElement)

  await step('should call handleContactClick', async () => {
    const btn = canvas.getByTestId('component-button')

    fireEvent.click(btn)

    expect(args.handleContactClick).toHaveBeenCalled()
  })
}
